import React, { useReducer } from 'react';
import logo from './logo.svg';
import './App.css';
import PageLayout from './PageLayout.js'

export default function App() {
  const [windows, dispatch] = useReducer(windowsReducer, ["home", "", "", ""])
  return (
    <PageLayout>
      <div style={{
        display: 'grid',
        gridTemplateAreas: `'a0 a1' 'a2 a3'`
      }}>

      </div>
    </PageLayout>
  );
}

function windowsReducer(windows, action) {
  switch (action.type) {
    case 'add': {
      return windows.with(action.position, action.newScreen)
    }
    case 'remove': {
      return windows.with(action.position, "")
    }
    default: {
      throw Error('Unknown action in windowsReducer: ' + action.type)
    }
  }
}
